-- Create Schema
CREATE SCHEMA clique_bait;


-- Create and Populate "event_identifier" table
DROP TABLE IF EXISTS clique_bait.event_identifier;
CREATE TABLE clique_bait.event_identifier (
  "event_type" INTEGER,
  "event_name" VARCHAR(13)
);



-- Create and Populate "campaign_identifier" table
DROP TABLE IF EXISTS clique_bait.campaign_identifier;
CREATE TABLE clique_bait.campaign_identifier (
  "campaign_id" INTEGER,
  "products" VARCHAR(3),
  "campaign_name" VARCHAR(33),
  "start_date" TIMESTAMP,
  "end_date" TIMESTAMP
);



-- Create and Populate "page_hierarchy" table
DROP TABLE IF EXISTS clique_bait.page_hierarchy;
CREATE TABLE clique_bait.page_hierarchy (
  "page_id" INTEGER,
  "page_name" VARCHAR(14),
  "product_category" VARCHAR(9),
  "product_id" INTEGER
);



-- Create and Populate "users" table
DROP TABLE IF EXISTS clique_bait.users;
CREATE TABLE clique_bait.users (
  "user_id" INTEGER,
  "cookie_id" VARCHAR(6),
  "start_date" TIMESTAMP
);



-- Create and Populate "events" table
DROP TABLE IF EXISTS clique_bait.events;
CREATE TABLE clique_bait.events (
  "visit_id" VARCHAR(6),
  "cookie_id" VARCHAR(6),
  "page_id" INTEGER,
  "event_type" INTEGER,
  "sequence_number" INTEGER,
  "event_time" TIMESTAMP
);

